import React from "react";
import Header from "./Header";
import Search from "./Search";
import { Box } from "@mui/material";
import Conversations from "./Conversations";

const Menu=()=>{
    return (
        <Box>
            <Header />
            <Search />
            <Conversations />
            Hello fom menu
        </Box>
    );
}

export default Menu;
